function NavbarCategorias(categories_list) {
    console.log(categories_list);
    categories = categories_list.categories_list;
    console.log(categories);
    return (
        <ul className='navbar-nav'>
            {categories.map(category => {
                return (
                    <li className='nav-item text-center'>
                        <button className='btn text-secondary bg-transparent text-hover-color' type='button' onclick={() => console.log(category)} id={category}>
                            {`${category.charAt(0).toUpperCase() + category.slice(1)}`}
                        </button>
                    </li>
                );
            })}
        </ul>
    );
}

export default NavbarCategorias;
